Today we honor Dr. Martin Luther King for his courage, strength, conviction and vision for a better world. Dr. King did not work alone - his wife Coretta Scott King and countless others were influential in the civil rights movement. Because of their extraordinary work, this #MLKDay we have listed some resources and organizations that advocate for Dr. King's vision and are taking action for a more fair and just society. xTory

@iamavoter, a nonpartisan movement that believes democracy works best when we all participate

@BrennanCenter for Justice, a nonpartisan law and policy institute working to reform and defend democracy and justice

@thekingcenter, the official memorial to MLK working to educate on non-violent social change and build community

